import React from 'react'

export default function Cart(props) {
  return (
    <div>
        Cart
        {props.userKinderim.map((kinder) => {
        return <h2>{kinder.productName}</h2>
      })}     
                    {/* <button onClick={() => props.removeFromCart(props.kinder)}>-</button> */}

    </div>
  )
}
